import Layout1 from '../components/LayoutForNav1';

export default function Security() {
    return (
        <Layout1>
            <h1 className="gg-u-text-megaphone">Security</h1>

            <p className="gg-u-mt-medium">Embrace life with no contracts. ooops... seems like we've got gremlins. Enjoy life with no contracts. ooops... seems like we've got gremlins. We do things differently. Embrace life with no contracts. Bob's your uncle. Join an award-winning network. No contracts.</p>
            <p>Bob's your uncle. Our super helpful members are available to offer support around the clock. Order your Free SIM. Run by you. We believe that together, with our members, anything is possible. Hi there. Bonnie to our Clyde. Save yourself a few bob. You're all that and a bag of chips.</p>
        </Layout1>
    );
}
